クリニカkids ハブラシ 仕上げ磨き用<br>ブランド：クリニカKid's<br>販売・製造元：ライオン<br><br>大人の方が持ちやすく、1本1本丁寧に磨ける子供用歯ブラシです。<br>超コンパクトヘッドで、お子様の小さなお口でも動かしやすくなっています。<br>はぐきへの当たり心地がやさしいソフト毛を使用しています。<br>(C)Disney <br>ご注意<br>●軽い力で小刻みに動かしてみがいてください。<br>●ハブラシをかむ等、強い力が加わると毛が抜けたり、折れたりすることがあります。<br>●ハブラシを口にくわえたまま走る、遊ぶ等をしないようにご注意ください。<br>●9才くらいまでは保護者の方が仕上げみがきをしてあげてください。<br> 品質表示●柄の材質：ポリプロピレン●毛の材質：ナイロン●毛の硬さ：やわらかめ●耐熱温度：80度<br> 原産国日本 <br><br>お問い合わせ先<br>■ライオン株式会社フリーダイヤル：0120-556-913 <br>日用品／オーラルケア／歯ブラシ／子供用歯ブラシ<br>JANコード： 4903301104285<br><br>CS：120<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
