歯垢除去に優れた黒の特殊毛（プラチナコロイドセラミックス配合）採用で水だけでも歯垢除去効果を実感できる「デンタルプロブラック」が、ブランドシリーズの統一感を演出するパッケージに生まれ変わりました。新パッケージにはアイテム別管理番号も記載。各アイテムをユーザー目線でも識別しやすく工夫しました。<br><br>日用品(\)オーラルケア(\)歯ブラシ<br>デンタルプロ ブラックハブラシ コンパクト かため<br>使い勝手のよいコンパクトヘッドで、歯のすみずみまで効果的にスッキリ磨ける歯ブラシ(かため)です。ブラシの用毛には、黒い特殊毛(プラチナコロイドセラミックス入り)を使用。水だけでも磨けます。※色はお選びいただけません。 使用上の注意・歯グキをいためないように軽めの力で磨いてください。・ご使用後は流水で充分洗い、水を切って風通しのよいところに保管して下さい。・変色、変形の恐れがありますので塩素系殺菌剤・漂白剤・熱湯などにはつけないでください。 <br>ご注意：色は4色(ブルー、グリーン、ピンク、イエロー)ありますが選べません。  製品仕様●柄の材質：本体部/ポリプロピレン、ラバー部：SBC●毛の材質：飽和ポリエステル樹脂●毛のかたさ：かため●耐熱温度：80度  <br>販売_製造元： デンタルプロ<br>ブランド：デンタルプロ<br>JAN：4973227206011<br>CS：120<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
