日用品／オーラルケア／歯ブラシ<br>クリニカ ハブラシ 3Dカット 4列 かため<br>奥歯や、歯と歯のスキ間など、あらゆる部位にフィットして歯垢をかき出す歯ブラシ(かため)です。立体(3D)マルチフィット構造。先端V字カットで、奥歯の奥やかみ合わせの歯垢をかき出し、段差極細毛が歯と歯の隙間の歯垢をかき出します。※色はブルー、オレンジ、グリーン、レッドの4色ありますが、色は選べませんのでご了承下さい。  <br>ご注意：<br>●毛先を上手に使って、軽く小刻みに磨きましょう。力の入れすぎは、歯ぐきを傷つける原因にもなります。<br>●歯の定期健診を受けましょう。<br>●毛先がひらいたらとりかえましょう。 品質表示●柄の材質・本体：飽和ポリエステル樹脂・ラバー部：ポリエステル、ポリエーテル、SBC●毛の材質：ナイロン/飽和ポリエステル樹脂●毛の硬さ：かため●耐熱温度：60度<br><br> お問い合わせ先：<br>ライオン株式会社お問合わせ先：0120-556-913  <br><br>販売_製造元： ライオン<br>ブランド：クリニカ<br>JAN：4903301152651<br><br>CS：120<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
