歯ブラシ／歯周病予防歯ブラシ<br><br>超極細毛の毛先が歯周ポケットに入り込んで歯垢を除去。<br><br>商品名：デンタルプロ ＊フレッシュ超極細毛　やわらかめ ＜2013年秋の新製品＞  ※ 9月24日 より順次出荷予定<br>フレッシュ超極細毛Ｓ１本<br>ブランド：フレツシユ<br><br><br><br> JAN：4973227212425<br>販売元：　デンタルプロ<br><br>CS：120<p>●歯周ポケットや奥歯のこまかい溝にも超極細の毛先が入り込み、歯周病や虫歯の原因となる歯垢を効果的に除去<br>●やさしい角をもつエッジ加工毛が歯の側面や歯と歯のかみ合わせの歯垢も効果的に除去<br>※ハンドルカラー(ピンク、ブルー、オレンジ)の指定はできません。<br><br>【原材料】<br>柄の材質・・・本体部：ポリプロピレン／ラバー部：SBC<br>毛の材質・・・飽和ポリエステル樹脂<br><br>【規格概要】<br>毛のかたさ・・・やわらかめ<br>耐熱温度・・・80度<br><br>【注意事項】<br>・歯グキをいためないように軽めの力で磨いてください。<br>・ご使用後は流水で充分洗い、水を切って風通しのよいところに保管してください。<br>・変色、変形の恐れがありますので塩素系殺菌剤、漂白剤、熱湯などにはつけないでください。</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
